To find the radius of the tank, we need to use the information given about the surface area of the tank and the dimensions of its rectangular base. The surface area \( S \) of a cylindrical tank with an open top is given by the formula:
\[ S = 2\pi rh + 2rh + r^2 = 2\pi rh + 2rh + r^2 = 2r(\pi h + h + \frac{r}{2}) \]
where \( r \) is the radius of the base and \( h \) is the height of the tank.

We know that the surface area is \( 20\pi \) square meters. So we can set up the equation:
\[ 2r(\pi h + h + \frac{r}{2}) = 10\pi + 4\pi \]
\[ 2r(\pi h + h + \frac{r}{2}) = 14\pi \]
\[ r(\pi h + h + \frac{r}{2}) = 7\pi \]
\[ r(\pi r + r + \pi h) = 7\pi \]
\[ r(\pi r + r + \pi h) = 7\pi \]
\[ r(\pi r + r + \pi h) = 7\pi \]

We also know that the perimeter of the rectangular base is 4 metr, so:
\[ 2l + 2w = 4 \]
\[ l + w = 2 \]

Since the base is a square (because the problem does not specify otherwise), \( l = w = r \). Therefore:
\[ r + r = 2 \]
\[ 2r = 2 \]
\[ r = 1 \]

