Let's denote the three consecutive integers by \( x-1 \), \( x \), and \( x+1 \). According to the problem, the sum of these three integers is 120. Therefore, we can write the equation:

\[
(x-1) + x + (x+1) = 120
\]

Simplifying the left side of the equation, we get:

\[
x-1 + x + x+1 = 3x = 120
\]

Next, we solve for \( x \) by dividing both sides of the equation by 3:

\[
x = \frac{120}{3} = 40
\]

So, the three consecutive integers are \( 39 \), \( 40 \), and \( 41 \). The problem states that the sum of the squares of these three integers divided by 24 is 24. Let's verify this:

First, we calculate the sum of the squares of the three integers:

\[
39^2 + 40^2 + 41^2 = 1521 + 1600 + 1681 = 4802
\]

Next, we divide this sum by 24:

\[
\frac{4802}{24} = 200.0833
\]

